  AiFillGithub,
  AiFillLinkedin,
  AiFillTwitterCircle,
} from "react-icons/ai";

const Contact = () => {
  return (
    <footer className="bg-mainBlue text-white flex gap-4">
      {/* Contact Info */}
      <div className="flex flex-col gap-4">
        <h1 className="text-2xl"> Contact Me</h1>
        <p>
          {" "}
          Please get in touch if you think our work could be mutually beneficial
        </p>

        <p> 1234 Random Road Random Town, Morroco 12345</p>

        <div className="flex gap-4">
          <BsTelephone />
          <p> 06-67-15-35-55</p>
        </div>

        <div className="flex gap-4">
          <CiMail />
          <p> hamza.eshoul.pro@gmail.com</p>
        </div>

        <div className="flex gap-2 text-3xl">
          <AiFillGithub />
          <AiFillLinkedin />
          <AiFillTwitterCircle />
        </div>
      </div>

      {/* Img */}
    </footer>
  );
};

export default Contact;
